        }
        public string GetRandomStringNumber(int start, int end, int length)
        {
            StringBuilder _str = new StringBuilder();
            for (int i = 0; i < length; i++)
            {
                _str.Append(_random.Next(start, end));
                if (_str.Length > length)
                    break;
            }

            return _str.ToString().Substring(0, length);
        }
        public int GetRandomIntNumber(int start, int end)
        {
            return _random.Next(start, end);
        }
        public double GetRandomDoubleNumber(int start, int end)
        {
            return _random.NextDouble();
        }
        public string GetRandomString(int length)
        {
            StringBuilder _str = new StringBuilder();
            for (int i = 0; i < length; i++)
            {
                _str.Append(_strAlphabet[_random.Next(0, _strAlphabet.Length)].ToString());
            }

            return _str.ToString();
        }
        public string GetRandomIp()
        {
